export const getEvents = (locat) => {
    let myHeader = new Headers();
    myHeader.append("Access-Control-Request-Headers", "access-control-allow-origin,content-type");
    myHeader.append("Access-Control-Allow-Origin", "http://192.168.0.3:3000/");
    myHeader.append("Access-Control-Request-Headers", "access-control-allow-origin");
    myHeader.append("Access-Control-Request-Method", "GET");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location=" + locat, {
        method: "GET",
        headers: myHeader,
        cache: "no-cache"
    }).then((res) => {
        return res;
    });
}
